import React from 'react';

interface HeaderProps {
  currentPage: 'upload' | 'search' | 'generate';
  onNavigate: (page: 'upload' | 'search' | 'generate') => void;
  documentCount: number;
}

const Header: React.FC<HeaderProps> = ({ currentPage, onNavigate, documentCount }) => {
  return (
    <header style={{
      background: 'linear-gradient(135deg, #1a1a2e 0%, #16213e 50%, #0f3460 100%)',
      color: '#ffffff',
      padding: '0',
      boxShadow: '0 4px 20px rgba(0, 0, 0, 0.3)',
      marginBottom: '30px',
      position: 'relative',
      borderBottom: '1px solid rgba(255,255,255,0.1)'
    }}>
      {/* 微妙な背景テクスチャ */}
      <div style={{
        position: 'absolute',
        top: '0',
        left: '0',
        right: '0',
        bottom: '0',
        background: `
          repeating-linear-gradient(
            90deg,
            transparent,
            transparent 2px,
            rgba(255,255,255,0.03) 2px,
            rgba(255,255,255,0.03) 4px
          )
        `,
        opacity: 0.5
      }} />

      <div style={{
        maxWidth: '1200px',
        margin: '0 auto',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '0 20px',
        position: 'relative',
        zIndex: 1
      }}>
        {/* ロゴ・タイトル */}
        <div style={{ padding: '20px 0' }}>
          <h1 style={{
            margin: '0',
            fontSize: '28px',
            fontWeight: '600',
            color: '#ffffff',
            letterSpacing: '0.5px'
          }}>
            📑 DocuMind Pro
          </h1>
          <p style={{
            margin: '4px 0 0 0',
            fontSize: '14px',
            color: '#b8c6db',
            fontWeight: '400'
          }}>
            Enterprise Document Intelligence Platform
          </p>
        </div>

        {/* ナビゲーション */}
        <nav style={{ display: 'flex', gap: '10px' }}>
          <button
            onClick={() => onNavigate('upload')}
            style={{
              background: currentPage === 'upload' 
                ? 'linear-gradient(135deg, #ff6b6b, #ff8e8e)' 
                : 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))',
              color: 'white',
              border: 'none',
              padding: '14px 24px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: '700',
              borderRadius: '50px',
              transition: 'all 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275)',
              backdropFilter: 'blur(15px)',
              boxShadow: currentPage === 'upload' 
                ? '0 8px 25px rgba(255, 107, 107, 0.4), inset 0 1px 0 rgba(255,255,255,0.2)' 
                : '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)',
              textShadow: '0 1px 2px rgba(0,0,0,0.3)',
              position: 'relative',
              overflow: 'hidden'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'upload') {
                e.currentTarget.style.background = 'linear-gradient(135deg, #ff8e8e, #ffb3b3)';
                e.currentTarget.style.transform = 'translateY(-3px) scale(1.05)';
                e.currentTarget.style.boxShadow = '0 12px 35px rgba(255, 107, 107, 0.3)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'upload') {
                e.currentTarget.style.background = 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))';
                e.currentTarget.style.transform = 'translateY(0) scale(1)';
                e.currentTarget.style.boxShadow = '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)';
              }
            }}
          >
            🚀 アップロード
          </button>
          <button
            onClick={() => onNavigate('search')}
            style={{
              background: currentPage === 'search' 
                ? 'linear-gradient(135deg, #4ecdc4, #44a08d)' 
                : 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))',
              color: 'white',
              border: 'none',
              padding: '14px 24px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: '700',
              borderRadius: '50px',
              transition: 'all 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275)',
              backdropFilter: 'blur(15px)',
              boxShadow: currentPage === 'search' 
                ? '0 8px 25px rgba(78, 205, 196, 0.4), inset 0 1px 0 rgba(255,255,255,0.2)' 
                : '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)',
              textShadow: '0 1px 2px rgba(0,0,0,0.3)'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'search') {
                e.currentTarget.style.background = 'linear-gradient(135deg, #5dddd4, #52c2ba)';
                e.currentTarget.style.transform = 'translateY(-3px) scale(1.05)';
                e.currentTarget.style.boxShadow = '0 12px 35px rgba(78, 205, 196, 0.3)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'search') {
                e.currentTarget.style.background = 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))';
                e.currentTarget.style.transform = 'translateY(0) scale(1)';
                e.currentTarget.style.boxShadow = '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)';
              }
            }}
          >
            🔥 検索
          </button>
          <button
            onClick={() => onNavigate('generate')}
            style={{
              background: currentPage === 'generate' 
                ? 'linear-gradient(135deg, #45b7d1, #96ceb4)' 
                : 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))',
              color: 'white',
              border: 'none',
              padding: '14px 24px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: '700',
              borderRadius: '50px',
              transition: 'all 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275)',
              backdropFilter: 'blur(15px)',
              boxShadow: currentPage === 'generate' 
                ? '0 8px 25px rgba(69, 183, 209, 0.4), inset 0 1px 0 rgba(255,255,255,0.2)' 
                : '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)',
              textShadow: '0 1px 2px rgba(0,0,0,0.3)'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'generate') {
                e.currentTarget.style.background = 'linear-gradient(135deg, #6cc3e0, #a8d5c4)';
                e.currentTarget.style.transform = 'translateY(-3px) scale(1.05)';
                e.currentTarget.style.boxShadow = '0 12px 35px rgba(69, 183, 209, 0.3)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'generate') {
                e.currentTarget.style.background = 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))';
                e.currentTarget.style.transform = 'translateY(0) scale(1)';
                e.currentTarget.style.boxShadow = '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)';
              }
            }}
          >
            ✨ 資料生成
          </button>
        </nav>

        {/* ドキュメント数表示 */}
        <div style={{
          background: 'linear-gradient(135deg, #ffeaa7, #fdcb6e)',
          border: '3px solid rgba(255,255,255,0.3)',
          padding: '15px 25px',
          borderRadius: '50px',
          fontSize: '16px',
          fontWeight: '800',
          backdropFilter: 'blur(15px)',
          boxShadow: '0 8px 25px rgba(255, 234, 167, 0.4), inset 0 1px 0 rgba(255,255,255,0.3)',
          display: 'flex',
          alignItems: 'center',
          gap: '10px',
          color: '#2d3436',
          textShadow: '0 1px 2px rgba(255,255,255,0.5)',
          animation: 'pulse 3s ease-in-out infinite',
          transform: 'perspective(1000px) rotateX(10deg)'
        }}>
          <span style={{ 
            fontSize: '22px',
            filter: 'drop-shadow(0 2px 4px rgba(45, 52, 54, 0.2))',
            animation: 'float 2s ease-in-out infinite'
          }}>💎</span>
          <span style={{ letterSpacing: '1px' }}>{documentCount}件</span>
        </div>
      </div>
    </header>
  );
};

export default Header;
